import { Box } from "@gluestack-ui/themed";
import { useEffect } from "react";
import axios from "axios";


useEffect(()=>{
    const fetchUserData = async () => {
        tokenString = await AsyncStorage.getItem('token');
        token = JSON.parse(tokenString);
        let idUser;
        let carUser = [];
        let caarEnd = [];
        let total=0;



        if (token) {

            try {
                const response = await axios.get("http://localhost/1.75/backend/public/api/Userauth", {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });
                setUserData(response.data);
                idUser = response.data.id;


            } catch (error) {
                console.log(" we cannot get the information ", error);
            }
        }
        try {
            const response = await axios.get(`http://localhost/1.75/backend/public/api/carr/${idUser}`);

            setCarData(response.data);
            console.log(response.data);
            
            response.data.forEach(element => {
                total += element.food.Price;
               
            });
            setTotalData(total);

        } catch (error) {
            console.log(" we cannot get the information car", error);
        }
        
    };

    fetchUserData();
}, []);

const account=()=>{
    <Box width={"$full"}>

    </Box>

}
export default account;
